import React from 'react';
import LoginForm from '/frontend/src/components/auth/login.js';


const Login = () => {
    return (
        <main className="section_animated">
            <div className="container">
                <h1 className="title-1">Login</h1>
                <LoginForm />
            </div>
        </main>
    );
};

export default Login;
